import { HttpClient, HttpHeaders } from '@angular/common/http';
let PageService = class PageService {
    constructor(http) {
        this.http = http;
        this.API_URL = 'https://salty-suite.herokuapp.com/api/pages';
        this.httpOptions = {
            headers: new HttpHeaders({
                'Content-Type': 'application/json'
            })
        };
    }
    getPages() {
        return this.http.get(`${this.API_URL}`);
    }
    getPageByUrl(url) {
        return this.http.get(url);
    }
    getPageByProjectId(projectId) {
        return this.http.get(`${this.API_URL}/${projectId}/project`);
    }
    getPageById(id) {
        return this.http.get(`${this.API_URL}/${id}`);
    }
    createPage(data) {
        return this.http.post(this.API_URL, data, this.httpOptions);
    }
    updatePagesPosition(id, data) {
        return this.http.put(`${this.API_URL}/${id}/updatePosition`, data, this.httpOptions);
    }
    deletePage(id) {
        return this.http.delete(`${this.API_URL}/${id}`);
    }
};
